import { IconButton } from "@material-ui/core";
import { Home as HomeIcon, Person as PersonIcon, Mail as MailIcon, Menu as MenuIcon } from "@material-ui/icons";
import "./sidebar.css";

const Sidebar = ({ handleDrawerToggle }) => {
  return (
    <div className="sidebar">
      <div className="sidebar-icons">
        <IconButton className="sidebar-icon">
          <HomeIcon />
        </IconButton>
        <IconButton className="sidebar-icon">
          <PersonIcon />
        </IconButton>
        <IconButton className="sidebar-icon">
          <MailIcon />
        </IconButton>
      </div>
      <IconButton className="navbar-icon" onClick={handleDrawerToggle}>
        <MenuIcon style={{ color: "#fff" }} />
      </IconButton>
    </div>
  );
};

export default Sidebar;
